import React, { Component } from "react";
import { Col, Row, Container } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.css";


export default class NavBar extends Component{
  render(){
  return (
    <div >
      <div className='ba tc' href="">
        <Container>
          <Row>
            <Col sm className='f4 tc ba ma1 b--dashed bg-blue'>{this.props.name}</Col>
            <Col xs={1} className='ba ma1'>1:3</Col>
            <Col md='auto'>BXX.XX</Col>
            <Col md='auto'>01.01.2020</Col>
            <Col xs= {1 } className='bg-blue'>
              <button className=''>More</button> 
            </Col>
          </Row>
        </Container>
      </div>
      <br/>
    </div>
  );
}
}
